import { Modal } from "react-bootstrap";
const CModal = () => {
  return (
    <Modal show={true} onHide={false} back>
      <Modal.Header>
        <Modal.Title>Welcome</Modal.Title>
      </Modal.Header>
    </Modal>
  );
};
export default CModal;
